#!/bin/sh
# Name: KiViStore
# DontUseFBInk
# Author: VladiG
# Icon: data:image/png;base64,

if [ ! -d /mnt/us/KiViStore ]; then
    curl -L -o /mnt/us/KiViStore.zip https://github.com/VladiGuive/KiViStore/archive/refs/heads/main.zip
    unzip -o /mnt/us/KiViStore.zip -d /mnt/us/
    rm /mnt/us/KiViStore.zip
    mv /mnt/us/KiViStore-main /mnt/us/KiViStore
    chmod +x /mnt/us/KiViStore/KiViStore.sh
fi

lsof -i :1122 -S | tail -n +2 | awk '{print $2}' | xargs kill -9
rm -rf /mnt/us/KiViStore/tmp/*
bash /mnt/us/KiViStore/kvsdaemon.sh </dev/null >> /mnt/us/KiViStore/tmp/kvsdaemon.log 2>&1 &
bash /mnt/us/KiViStore/kvsbrowser.sh </dev/null >> /mnt/us/KiViStore/tmp/kvsbrowser.log 2>&1 &